import React from 'react';
import FilterJobSearch from './FilterJobSearch';
import SearchBar from './SearchBar';
import JobListings from './JobListings';

function Homepage() {
  return (
    <div className="index">
      <NavigationBar />
      <FilterJobSearch />
      <SearchBar />
      <JobListings />
    </div>
  );
}

export default Homepage;
